  true,\n\t\"url\": null,\n\t\"notes\": \"U.S. Population Grids (Summary File 1),
  2000: Houston Metropolitan Statistical Area, Alpha Version contains an ARC/INFO
  Workspace with grids of demographic data from the 2000 census. The grids have a
  resolution of 7.5 arc-seconds (0.002075 decimal degrees), or approximately 250 square
  meters. The gridded variables are based on census block geography from Census 2000
  TIGER/Line Files and census variables (population, households, and housing variables)
  from Summary File 1. This dataset is produced by the Columbia University Center
  for International Earth Science Information Network (CIESIN).\",\n\t\"license_title\":
